import React from 'react';

const QuizResult = ({ result }) => {
  return (
    <div>
      <h2>Quiz Result</h2>
      <p>You scored: {result}%</p>
      {/* Additional feedback or details about the result */}
    </div>
  );
};

export default QuizResult;
